import React, { Fragment, Component } from 'react';
import Link from 'next/link';

const people = [
    {v: 'car', name: 'Bruno'},
    {v: 'bike', name: 'John'},
    {v: 'airplane', name: 'Mick'},
];

class Index extends Component {
    state = {

    };

    render(){
        return(
            <div>
                <Link href={'/'}>
                    Home
                </Link>
                <Link as={'/list'} href={'/list'}>
                    List
                </Link>
                <Link as={'/food'} href={'/food'}>
                    Food
                </Link>
                <Link as={'/food/bob'} href={'/[file]/[action]'}>
                    List
                </Link>
                {
                    people.map(e => (
                        <Link as={`/${e.v}/${e.name}`} href={'/[file]/[action]'}>
                            <a> Navigate to ${e.v} </a>
                        </Link>
                    ))
                }

                <div>Hello World!</div>
            </div>
        )
    }
}

export default Index;
